import React from 'react';

export default function RecipeCard(props) {
  return (
    <div> 
      <p> 
        { props.title }  
      </p>
      <p> 
        { props.image }  
      </p>
      <p> 
        { props.dishTypes }  
      </p>
      <p> 
        { props.diets }  
      </p>
    </div>
  )
};
